import React from 'react';
import ExList from '../view/ExList';

class ExListContainer extends React.Component {
  state = {
    data: {
      id: 'root',
      name: 'Parent',
      children: [
        {
          id: '1',
          name: '1',
        },
        {
          id: '3',
          name: '3',
          children: [
            {
              id: '4',
              name: '4',
            },
          ],
        },
      ],
    },
  };

  render() {
    return <ExList></ExList>;
  }
}

export default ExListContainer;
